import React from 'react';
import classNames from 'classnames';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing.unit,
  },
  withoutLabel: {
    marginTop: theme.spacing.unit * 3,
  },
  textField: {
    flexBasis: 200,
  },
  card: {
    maxWidth: 345,
  },
  media: {
    // ⚠️ object-fit is not supported by IE 11.
    objectFit: 'cover',
  },
});

const ranges = [
  {
    value: '0-20',
    label: '0 to 20',
  },
  {
    value: '21-50',
    label: '21 to 50',
  },
  {
    value: '51-100',
    label: '51 to 100',
  },
];

class BookDelivery extends React.Component {
  state = {
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  };

  render() {
    const { classes } = this.props;

    return (
      <div className={classes.root}>
      <Card className={classes.card}>
        <CardActionArea>
            <TextField
            id="pick-up-location"
            className={classNames(classes.margin, classes.textField)}
            InputProps={{
                startAdornment: <InputAdornment position="start">PICKUP</InputAdornment>,
            }}
            />
            <br/>
            <TextField
            id="drop-location"
            className={classNames(classes.margin, classes.textField)}
            InputProps={{
                startAdornment: <InputAdornment position="start">DROP</InputAdornment>,
            }}
            />
            <br/>
            <TextField
            select
            className={classNames(classes.margin, classes.textField)}
            value={this.state.weightRange}
            onChange={this.handleChange('weightRange')}
            InputProps={{
                startAdornment: <InputAdornment position="start">WHEN</InputAdornment>,
            }}
            >
            {ranges.map(option => (
                <MenuItem key={option.value} value={option.value}>
                {option.label}
                </MenuItem>
            ))}
            </TextField>
        </CardActionArea>
        <CardActions>
            <Button size="small" color="primary">
            
            </Button>
            <Button size="small" color="primary">
            Learn More
            </Button>
        </CardActions>
      </Card>
        

        
      </div>
    );
  }
}

BookDelivery.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(BookDelivery);
